import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import UserService from "../services/userservice";

export default class Registration extends Component{

    constructor(props) {
        super(props);
    
        this.state = {
          currentUser: UserService.getCurrentUser()
        };
      }

    render(){
        return(
            <div>
                <h1>Dashboard</h1>
                {' '}
                <div>
                    <h1>WElcome</h1>
                </div>
                {' '}
            </div>
        );
    }
}
